webpackJsonp([1163],{"./node_modules/json-loader/index.js!./.cache/json/articles-javascript-javascript-stringprototypeindexof.json":function(e,n){e.exports={data:{markdownRemark:{html:"<p>The indexOf() method returns the index within the calling String object of the first occurrence of the specified value, starting the search at fromIndex. Returns -1 if the value is not found.</p>\n<p><strong>Syntax</strong>  </p>\n<pre><code>str.indexOf(searchValue[, *fromIndex*]);\n</code></pre>\n<h3>Parameters</h3>\n<p><strong>searchValue</strong><br>\nA character/string whose index is to be found.</p>\n<p><strong>fromIndex</strong><br>\nOptional. The location within the calling string to start the search from. It can be any integer. The default value is 0. If <code>fromIndex &#x3C; 0</code> the entire string is searched (same as passing 0). If <code>fromIndex >= str.length</code>, the method will return -1 unless <code>searchValue</code> is an empty string in which case <code>str.length</code> is returned.</p>\n<h2>Description</h2>\n<p>Characters in a string are indexed from left to right. The index of the first character is 0, and the index of the last character of a string called <code>str</code> is <code>str.length - 1</code>.</p>\n<h2>Examples</h2>\n<p><strong>Finding a character in a string</strong>  </p>\n<pre><code>var str1 = \"Hello\";\nconsole.log(str1.indexOf('H'));\n// Console will output: 0\n\nvar str1 = \"Hello\";\nconsole.log(str1.indexOf('Y'));\n// Console will output: -1.\n</code></pre>\n<p><strong>indexOf() is case-sensitive</strong>  </p>\n<pre><code>var str1 = \"Hello\";\nconsole.log(str1.indexOf('ello'));\n// Console will output 1\n\nvar str1 = \"Hello\";\nconsole.log(str1.indexOf('Ello'));\n// Console will output -1\n</code></pre>\n<p><strong>indexOf() with fromIndex</strong>  </p>\n<pre><code>var str1 = \"FreeCodeCamp is a place for people to learn\";\nconsole.log(str1.indexOf('Camp'));\n// Console will output 8\n\nconsole.log(str1.indexOf('Camp', 9));\n// Console will output -1\n</code></pre>\n<p>Source <a href=\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/String/indexOf\">MDN</a></p>",frontmatter:{title:"String.prototype.indexOf",parent:"/home/stuart/guides/src/pages/articles/javascript/javascript-stringprototypeindexof/index.md absPath of file"}}},pathContext:{slug:"/articles/javascript/javascript-stringprototypeindexof/"}}}});
